query importedCharacterQuery {
  Character(id: 80) {
    name {
      full
      native
    }
  }
}

query importedLongMediaQuery(
  $id: Int
) {
  Media(id: $id, type: ANIME) {
    _id: id
    title {
      native
      english
    }
  }
}

query importedMediaQuery {
  Media(id: 80) {
    title {
      english
      romaji
    }
  }
}

